import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { Button } from 'react-bootstrap';
import {
  createBrowserRouter,
  RouterProvider,
  Link,
  Switch,
  Routes,
  Route
} from "react-router-dom";

function App() {


  return (
    <div className="App">
      <header className="App-header">
        <div>
          Saudi Chat GPT
        </div>
        <div className='headerTitle'>معلومات المشروع</div>
      </header>



      <div className="Container">

        <div className='boxContainer'>



          <div className='leftBox'>

            <p>انشئ وطوّر منتجات/تطبيقات بشكل متميز وسريع باستخدام ChatGPT & Whisper APIs
              تعلم واختبر مهاراتك ولا تفوت الفرصة بالحصول على دعم لمشروعك</p>

            <Link to="/FeasibilityInfo">
              <Button variant="success" className="rightBoxButton">
                إبدأ
              </Button>
            </Link>

          </div>

          <div className='rightBox'>

          </div>

        </div>

      </div>
    </div>
  );
}

export default App;
